    "If you leave this page without submitting your peer assessment, you will lose any work you have done.": "Si vous quittez cette page sans envoyer votre \u00e9valuation par les pairs, vous perdrez tout le travail r\u00e9alis\u00e9.",
    "If you leave this page without submitting your self assessment, you will lose any work you have done.": "Si vous quittez cette page sans envoyer votre auto-\u00e9valuation, vous perdrez tout le travail r\u00e9alis\u00e9.",
    "If you leave this page without submitting your staff assessment, you will lose any work you have done.": "Si vous quittez cette page sans envoyer votre \u00e9valuation par l'\u00e9quipe p\u00e9dagogique, vous perdrez tout le travail r\u00e9alis\u00e9.",
    "If you make significant changes, make sure you notify members of the team before making these changes.": "Trong tr\u01b0\u1eddng h\u1ee3p b\u1ea1n mu\u1ed1n t\u1ea1o ra nh\u1eefng thay \u0111\u1ed5i l\u1edbn, b\u1ea1n n\u00ean th\u00f4ng b\u00e1o tr\u01b0\u1edbc v\u1edbi c\u00e1c th\u00e0nh vi\u00ean c\u1ee7a nh\u00f3m v\u1ec1 nh\u1eefng thay \u0111\u1ed5i n\u00e0y.",
    "If you make this %(xblockType)s visible to learners, learners will be able to see its content after the release date has passed and you have published the unit. Only units that are explicitly hidden from learners will remain hidden after you clear this option for the %(xblockType)s.": "N\u1ebfu b\u1ea1n l\u00e0m cho %(xblockType)s n\u00e0y hi\u1ec3n th\u1ecb v\u1edbi ng\u01b0\u1eddi h\u1ecdc, ng\u01b0\u1eddi h\u1ecdc s\u1ebd c\u00f3 th\u1ec3 xem n\u1ed9i dung c\u1ee7a n\u00f3 sau ng\u00e0y ph\u00e1t h\u00e0nh v\u00e0 sau khi b\u1ea1n \u0111\u00e3 xu\u1ea5t b\u1ea3n \u0111\u01a1n v\u1ecb. Ch\u1ec9 c\u00f3 nh\u1eefng \u0111\u01a1n v\u1ecb \u1ea9n \u0111\u1ed1i v\u1edbi ng\u01b0\u1eddi h\u1ecdc s\u1ebd v\u1eabn \u1ea9n sau khi b\u1ea1n \u0111\u00e3 xo\u00e1 t\u00f9y ch\u1ecdn n\u00e0y cho %(xblockType)s.",
    "If you remove this transcript, the transcript will not be available for any components that use this video.": "Si vous supprimez cette transcription, la transcription ne sera disponible pour aucun des composants utilisant cette vid\u00e9o.",
    "If you remove this transcript, the transcript will not be available for this component.": "Si vous supprimez cette transcription, la transcription ne sera pas disponible pour ce composant.",
    "If you require assistance with taking either photo for submission, contact %(platformName)s support for additional suggestions.": "Si vous avez besoin d'aide pour prendre l'une ou l'autre des photos \u00e0 soumettre, contactez le support de %(platformName)s pour des suggestions suppl\u00e9mentaires.",
    "If you select an option other than \"%(hide_label)s\", published units in this subsection become available to learners unless they are explicitly hidden.": "N\u1ebfu b\u1ea1n ch\u1ecdn m\u1ed9t t\u00f9y ch\u1ecdn kh\u00e1c v\u1edbi \"%(hide_label)s\", nh\u1eefng \u0111\u01a1n v\u1ecb \u0111\u00e3 xu\u1ea5t b\u1ea3n trong ph\u1ea7n con n\u00e0y s\u1ebd su\u1ea5t hi\u1ec7n cho ng\u01b0\u1eddi h\u1ecdc tr\u1eeb khi ch\u00fang \u0111\u01b0\u1ee3c \u1ea9n m\u1ed9t c\u00e1ch r\u00f5 r\u00e0ng.",
    "If you still wish to continue and delete your account, please enter your account password:": "N\u1ebfu b\u1ea1n v\u1eabn mu\u1ed1n ti\u1ebfp t\u1ee5c v\u00e0 x\u00f3a t\u00e0i kho\u1ea3n c\u1ee7a m\u00ecnh, vui l\u00f2ng nh\u1eadp m\u1eadt kh\u1ea9u t\u00e0i kho\u1ea3n c\u1ee7a b\u1ea1n:",
