    "We couldn't find any results for \"%s\".": "Kh\u00f4ng th\u1ec3 t\u00ecm th\u1ea5y k\u1ebft qu\u1ea3 cho \"%s\".",
    "We couldn't sign you in.": "Ch\u00fang t\u00f4i kh\u00f4ng th\u1ec3 \u0111\u0103ng nh\u1eadp cho b\u1ea1n.",
    "We have encountered an error. Refresh your browser and then try again.": "\u0110\u00e3 ph\u00e1t hi\u1ec7n l\u1ed7i. L\u00e0m m\u1edbi l\u1ea1i tr\u00ecnh duy\u1ec7t c\u1ee7a b\u1ea1n r\u1ed3i th\u1eed l\u1ea1i.",
    "We have received your information and are verifying your identity. You will see a message on your dashboard when the verification process is complete (usually within 5-7 days). In the meantime, you can still access all available course content.": "Nous avons re\u00e7u vos informations et v\u00e9rifions votre identit\u00e9. Vous verrez un message sur votre Tableau de bord une fois termin\u00e9 le processus de v\u00e9rification (g\u00e9n\u00e9ralement dans les 5-7 jours). Entretemps, vous pourrez toujours acc\u00e9der au contenu de tous les cours disponibles.",
    "We just need a little more information before you start learning with %(platformName)s.": "Ch\u00fang t\u00f4i ch\u1ec9 c\u1ea7n th\u00eam m\u1ed9t ch\u00fat th\u00f4ng tin tr\u01b0\u1edbc khi b\u1ea1n b\u1eaft \u0111\u1ea7u h\u1ecdc v\u1edbi %(platformName)s.",
    "We securely encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "Nous chiffrons votre photo en toute s\u00e9curit\u00e9 et l'envoyons \u00e0 notre service d'autorisation pour v\u00e9rification. Votre photo et les informations ne sont pas enregistr\u00e9es ou visibles ailleurs sur  %(platformName)s une fois le processus de v\u00e9rification termin\u00e9.",
    "We use the highest levels of security available to encrypt your photo and send it to our authorization service for review. Your photo and information are not saved or visible anywhere on %(platformName)s after the verification process is complete.": "Ch\u00fang t\u00f4i s\u1eed d\u1ee5ng c\u00e1c m\u1ee9c b\u1ea3o m\u1eadt cao nh\u1ea5t c\u00f3 s\u1eb5n \u0111\u1ec3 m\u00e3 h\u00f3a h\u00ecnh \u1ea3nh c\u1ee7a b\u1ea1n v\u00e0 g\u1eedi n\u00f3 \u0111\u1ebfn d\u1ecbch v\u1ee5 \u1ee7y quy\u1ec1n c\u1ee7a ch\u00fang t\u00f4i \u0111\u1ec3 xem x\u00e9t. \u1ea2nh v\u00e0 th\u00f4ng tin c\u1ee7a b\u1ea1n s\u1ebd kh\u00f4ng \u0111\u01b0\u1ee3c l\u01b0u hay b\u1ea5t c\u1ee9 n\u01a1i n\u00e0o c\u00f3 th\u1ec3 nh\u00ecn th\u1ea5y tr\u00ean %(platformName)s sau khi qu\u00e1 tr\u00ecnh x\u00e1c minh ho\u00e0n t\u1ea5t.",
    "We use your verification photos to confirm your identity and ensure the validity of your certificate.": "Nous utilisons vos photos de v\u00e9rification pour confirmer votre identit\u00e9 et assurer la validit\u00e9 de votre certificat.",
    "We're sorry to see you go! Your account will be deleted shortly.": "Ch\u00fang t\u00f4i r\u1ea5t ti\u1ebfc khi th\u1ea5y b\u1ea1n ra \u0111i! T\u00e0i kho\u1ea3n c\u1ee7a b\u1ea1n s\u1ebd \u0111\u01b0\u1ee3c x\u00f3a ngay.",
    "We're sorry, there was an error": "R\u1ea5t ti\u1ebfc, c\u00f3 l\u1ed7i x\u1ea3y ra",
    "We've encountered an error. Refresh your browser and then try again.": "\u0110\u00e3 c\u00f3 l\u1ed7i x\u1ea3y ra. H\u00e3y refresh tr\u00ecnh duy\u1ec7t c\u1ee7a b\u1ea1n r\u1ed3i th\u1eed l\u1ea1i.",
    "We've sent a confirmation message to {new_email_address}. Click the link in the message to update your email address.": "Ch\u00fang t\u00f4i \u0111\u00e3 g\u1eedi m\u1ed9t th\u00f4ng b\u00e1o x\u00e1c nh\u1eadn \u0111\u1ebfn {new_email_address}. Nh\u1ea5p v\u00e0o li\u00ean k\u1ebft trong th\u00f4ng b\u00e1o \u0111\u00f3 \u0111\u1ec3 c\u1eadp nh\u1eadt \u0111\u1ecba ch\u1ec9 email c\u1ee7a b\u1ea1n.",
    "We've sent a confirmation message to {new_secondary_email_address}. Click the link in the message to update your secondary email address.": "Ch\u00fang t\u00f4i \u0111\u00e3 g\u1eedi m\u1ed9t tin nh\u1eafn x\u00e1c nh\u1eadn t\u1edbi {new_secondary_email_address}. Nh\u1ea5p v\u00e0o li\u00ean k\u1ebft trong tin nh\u1eafn \u0111\u1ec3 c\u1eadp nh\u1eadt \u0111\u1ecba ch\u1ec9 email ph\u1ee5 c\u1ee7a b\u1ea1n.",
    "We've sent a message to {email}. Click the link in the message to reset your password. Didn't receive the message? Contact {anchorStart}technical support{anchorEnd}.": "Ch\u00fang t\u00f4i \u0111\u00e3 g\u1eedi m\u1ed9t th\u00f4ng b\u00e1o \u0111\u1ebfn {email}. B\u1ea5m v\u00e0o li\u00ean k\u1ebft trong th\u00f4ng b\u00e1o \u0111\u1ec3 \u0111\u1eb7t l\u1ea1i m\u1eadt kh\u1ea9u. Kh\u00f4ng nh\u1eadn \u0111\u01b0\u1ee3c th\u00f4ng b\u00e1o? Li\u00ean h\u1ec7 {anchorStart} h\u1ed7 tr\u1ee3 k\u1ef9 thu\u1eadt {anchorEnd}.",
