    "You can use your {accountName} account to sign in to your {platformName} account.": "B\u1ea1n c\u00f3 th\u1ec3 s\u1eed d\u1ee5ng t\u00e0i kho\u1ea3n {accountName} \u0111\u1ec3 \u0111\u0103ng nh\u1eadp v\u00e0o t\u00e0i kho\u1ea3n {platformName} c\u1ee7a m\u00ecnh.",
    "You can view your information or unlink from {enterprise_name} anytime in your Account Settings.": "Vous pouvez voir votre information ou vous d\u00e9connectez de {enterprise_name}\u00a0\u00e0 tout moment dans vos Param\u00e8tres de compte.",
    "You cannot view the course as a student or beta tester before the course release date.": "L\u00e0 h\u1ecdc vi\u00ean ho\u1eb7c ng\u01b0\u1eddi d\u00f9ng b\u1ea3n th\u1eed nghi\u1ec7m, b\u1ea1n kh\u00f4ng th\u1ec3 xem kh\u00f3a h\u1ecdc tr\u01b0\u1edbc ng\u00e0y khai gi\u1ea3ng.",
    "You changed a video URL, but did not change the timed transcript file. Do you want to use the current timed transcript or upload a new .srt transcript file?": "B\u1ea1n \u0111\u00e3 thay \u0111\u1ed5i m\u1ed9t URL c\u1ee7a video, nh\u01b0ng kh\u00f4ng thay \u0111\u1ed5i t\u1ec7p b\u1ea3n d\u1ecbch \u0111\u1ed3ng b\u1ed9 th\u1eddi gian. B\u1ea1n mu\u1ed1n s\u1eed d\u1ee5ng b\u1ea3n d\u1ecbch \u0111\u1ed3ng b\u1ed9 th\u1eddi gian hi\u1ec7n t\u1ea1i hay t\u1ea3i l\u00ean t\u1ec7p b\u1ea3n d\u1ecbch .srt m\u1edbi?",
    "You commented...": "B\u1ea1n \u0111\u00e3 b\u00ecnh lu\u1eadn...",
