    "You could not be unsubscribed from this post. Refresh the page and try again.": "B\u1ea1n kh\u00f4ng th\u1ec3 h\u1ee7y b\u00e0i n\u00e0y. L\u00e0m m\u1edbi l\u1ea1i trang v\u00e0 th\u1eed l\u1ea1i.",
    "You currently have no cohorts configured": "Hi\u1ec7n t\u1ea1i b\u1ea1n ch\u01b0a x\u00e1c l\u1eadp c\u00e1c nh\u00f3m h\u1ecdc vi\u00ean",
    "You did not select a content group": "B\u1ea1n ch\u01b0a ch\u1ecdn n\u1ed9i dung cho nh\u00f3m h\u1ecdc:",
    "You did not select any files to submit.": "B\u1ea1n \u0111\u00e3 kh\u00f4ng ch\u1ecdn b\u1ea5t k\u1ef3 t\u1ec7p n\u00e0o \u0111\u1ec3 g\u1eedi.",
